    // * массив 
    const arrEngineering = [
        document.querySelector(".engineering-projectable__num"),
        document.querySelector(".engineering-projectable__title"),
        document.querySelector(".engineering-projectable__shtrih"),
        document.querySelector(".engineering-projectable__kraken"),
        document.querySelector(".engineering-projectable__info"),
        document.querySelector(".engineering-projectable__description"),
        document.querySelector(".engineering-projectable__kraken"),
        document.querySelector(".engineering-projectable__button"),
        document.querySelector(".engineering-projectable__flowers"),
    ];

    // * fn
    const observer = new IntersectionObserver((entries, fn) => {
        entries.forEach(entry => {
            if (entry.isIntersecting) {
                const node  = entry.target;

                // экран проектирование
                if(node === document.querySelector(".engineering-projectable__num")) {
                    node.classList.add("is-animate");
                }

                if(node === document.querySelector(".engineering-projectable__title")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    }, 1500);
                }

                if(node === document.querySelector(".engineering-projectable__shtrih")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    }, 2000);
                }

                if(node === document.querySelector(".engineering-projectable__kraken")) {}

                if(node === document.querySelector(".engineering-projectable__info")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate")
                    }, 3500);
                    setTimeout(()=>{
                        node.classList.add("is-animate-line")
                    }, 4000);
                }

                if(node === document.querySelector(".engineering-projectable__description")){
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    }, 1000);

                    setTimeout(()=>{
                        node.classList.add("is-animate-border");
                    }, 2000);
                }

                if(node === document.querySelector(".engineering-projectable__kraken")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate")
                    }, 4000);
                    setTimeout(()=>{
                        node.classList.add("is-animate-move")
                        node.classList.add("is-animate")
                    }, 4500);
                }

                if(node === document.querySelector(".engineering-projectable__button")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    }, 1000);
                }

                if(node === document.querySelector(".engineering-projectable__flower")){
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    }, 1000)
                }

                if(node === document.querySelector(".engineering-projectable__flower")){
                    node.classList.add("is-animate");
                }

                if(node === document.querySelector(".engineering-projectable__flowers")) {
                    setTimeout(()=>{
                        node.classList.add("is-animate");
                    },2500);
                }
            }
        });
    });

    if(document.querySelector(".engineering")) {
        arrEngineering.forEach(element=>{
            observer.observe(element);
        });
    }

    const flowerBuds = document.querySelectorAll(".engineering-projectable__flower-bud");

