    // ========
    if(document.querySelector(".item-hovering-link")) {
        const hoveringItems =  document.querySelectorAll(".item-hovering-link");

        hoveringItems.forEach(item=>{
            const nodeText = item.textContent.trim();
            const textNodeArr = nodeText.split('');

            const linkNode = item.querySelector("a");
            linkNode.innerHTML = "";

            textNodeArr.forEach((letter, key)=>{
                const nodeLetter = document.createElement("span");
                nodeLetter.innerHTML = letter;

                nodeLetter.classList.add("item-hovering-link__lettter");
                nodeLetter.classList.add(`item-hovering-link__lettter_${key + 1}`);
                nodeLetter.style = `--transform-key: ${key + 2}px; animation-delay: 0.${key + 1}s`;

                linkNode.appendChild(nodeLetter);
            });
        });
    }
